  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake NWR
  outlines Refuge accomplishments from May through July of 1940. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, fish, and disease- is also covered. The
  Refuge development and maintenance section discusses physical developments and plantings.
  Resource management is outlined; topics include grazing, cooperative farming, and
  haying. A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses. Photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
